import React from 'react';
import ReactPlayer from 'react-player';

function ProductVideo ({videoURL}) {

    return (
        <div className="video-div">
            <ReactPlayer 
                url={videoURL}
                playing={true}
                controls={true}
                width={'600px'}
                height={'500px'}
                stopOnUnmount={true}
            />
        </div>
    )
}

export default ProductVideo;
